import React from "react";
import { Link } from 'react-router-dom';
import '../../navbar.css';

function Navbar(props) {
    return (
        <nav className="nav">
            <Link to="./" className="home-link" id="home">Wilson's Blog</Link>
            <ul>
                <li><Link to="./blogs" className="main-links" id="main-links">Blogs</Link></li>
                <li><Link to="/about" className="main-links">About</Link></li>
                <li><Link to="/contact" className="main-links">Contact</Link></li>
                <li><Link to="/login" className="main-links">Login</Link></li>
            </ul>
            <div className="nav-toggler">
                <div className="line1"></div>
                <div className="line2"></div>
                <div className="line3"></div>
            </div>
        </nav>
    );
}

export default Navbar;
